import React from 'react';
import '../../App.css';

export default function Services() {
  return (
    <div className="services-page">
      <div className="services-photo">
  {/* Replace 'your-image.jpg' with your actual image path */}
  <img src="images/us.jpg" alt="Contact" style={{ width: '100%', height: '100%', objectFit: 'cover', borderRadius: '16px' }} />
</div>
      <div className="services-text">
        <h1 className="services">CONTACT ME PLZ</h1>
        <p>
          One thing I HATE to do is sleep on bad terms. Last night it was late, and my fault but idk I just can't sleep properly. I would rather have you in my presence, on call, even if we are saying nothing. Your presence, in an empty room could fill it up with love. I love you so much, call me ANYIME when you're free. Like every other day, I'm probably thinking of you as your reading this.
        </p>
      </div>
    </div>
  );
}
